import styled from "styled-components";

export const ModalWindow = styled.div`
  position: fixed;
  background-color: #2b224a;
  height: auto;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  font-size: 14px;
  line-height: 20px;
  border-radius: 16px;
  color: #d2cbe9;
  padding: 5px 0;
`;

export default ModalWindow;
